import React from 'react';
import data from './data';
import './cards.css'

function Card(props) {
  let averagePrice = 0
  for (let i = 0; i < data.length; i++){
    averagePrice+= data[i].price
  }
  averagePrice = averagePrice / data.length
  let priceDifference = Math.round(props.price - averagePrice)
  let text
  if (props.price > averagePrice) {
    text = "overvalued"
  }

  return (
    <span className='card'>
      { 
        text &&
        <div className="card--badge">{text}</div>
      }
        <img src={props.image} className='card-image'/>
        <div className='text'>
          <p>{props.name}</p>
          <p>Service: {props.service}</p>
          <p>Price: {props.price}</p>
        </div>
    </span>
  );
}

export default Card;
